pr_body:
This PR uses the updated `readELF` API (implemented in https://github.com/apple/swift/pull/33321) when setting up reflection from ELF files.

Also depends on https://github.com/apple/swift/pull/33358.

@adrian-prantl @vedantk

pr_review_comments:
[{'comment_id': 443042832, 'comment_body': 'This can probably be shuffled along with the the rest of the definitions (and should be the same on ELF and COFF already).', 'comment_created': datetime.datetime(2020, 6, 19, 21, 3, 31, tzinfo=datetime.timezone.utc), 'commenter': 'compnerd', 'type': 'User'}, {'comment_id': 443043882, 'comment_body': "Ok! I figured we might want two different versions (one for ELF, one for COFF), that's why I left it in.", 'comment_created': datetime.datetime(2020, 6, 19, 21, 5, 10, tzinfo=datetime.timezone.utc), 'commenter': 'augusto2112', 'type': 'User'}, {'comment_id': 443044710, 'comment_body': "@compnerd Since I'm removing this, I can delete both `ImageInspectionCOFF.h` and `ImageInspectionELF.h` right?", 'comment_created': datetime.datetime(2020, 6, 19, 21, 8, 9, tzinfo=datetime.timezone.utc), 'commenter': 'augusto2112', 'type': 'User'}, {'comment_id': 443048199, 'comment_body': "@compnerd @augusto2112 I'm not sure I understand how this part works. I thought the COFF sections had to be declared with abbreviated names?", 'comment_created': datetime.datetime(2020, 6, 19, 21, 20, 20, tzinfo=datetime.timezone.utc), 'commenter': 'vedantk', 'type': 'User'}, {'comment_id': 443048208, 'comment_body': 'Precisely.', 'comment_created': datetime.datetime(2020, 6, 19, 21, 20, 21, tzinfo=datetime.timezone.utc), 'commenter': 'compnerd', 'type': 'User'}, {'comment_id': 443048512, 'comment_body': 'Ugh, unified diffs ... I misread that.  Yes, the section names are different, thats why we need the two files, but everything else should be the same.', 'comment_created': datetime.datetime(2020, 6, 19, 21, 21, 23, tzinfo=datetime.timezone.utc), 'commenter': 'compnerd', 'type': 'User'}, {'comment_id': 443048949, 'comment_body': 'The section names should rename the same, just the names for the structure are the same.', 'comment_created': datetime.datetime(2020, 6, 19, 21, 22, 51, tzinfo=datetime.timezone.utc), 'commenter': 'compnerd', 'type': 'User'}, {'comment_id': 443074665, 'comment_body': 'These two are swapped', 'comment_created': datetime.datetime(2020, 6, 19, 23, 14, 40, tzinfo=datetime.timezone.utc), 'commenter': 'compnerd', 'type': 'User'}, {'comment_id': 443075357, 'comment_body': 'Fixed', 'comment_created': datetime.datetime(2020, 6, 19, 23, 19, 11, tzinfo=datetime.timezone.utc), 'commenter': 'augusto2112', 'type': 'User'}, {'comment_id': 443080283, 'comment_body': 'Does Windows testing fail if the `SectionName != ".sw5cptr" && SectionName != ".sw5bltn"` check is kept?', 'comment_created': datetime.datetime(2020, 6, 19, 23, 54, 15, tzinfo=datetime.timezone.utc), 'commenter': 'vedantk', 'type': 'User'}, {'comment_id': 443080591, 'comment_body': 'The #endif comments for SWIFT_RUNTIME_IMAGEINSPECTIONCOMMON_H and !defined(__MACH__) are swapped, I think.', 'comment_created': datetime.datetime(2020, 6, 19, 23, 56, 16, tzinfo=datetime.timezone.utc), 'commenter': 'vedantk', 'type': 'User'}, {'comment_id': 443081526, 'comment_body': 'Yes, that will fail.  The section contents will be offset due to the headers and footer.', 'comment_created': datetime.datetime(2020, 6, 20, 0, 3, 25, tzinfo=datetime.timezone.utc), 'commenter': 'compnerd', 'type': 'User'}, {'comment_id': 443081528, 'comment_body': 'Yes it does!', 'comment_created': datetime.datetime(2020, 6, 20, 0, 3, 26, tzinfo=datetime.timezone.utc), 'commenter': 'augusto2112', 'type': 'User'}, {'comment_id': 443081661, 'comment_body': "Oh whoops! You're correct. Should I push now or wait for the tests to finish?", 'comment_created': datetime.datetime(2020, 6, 20, 0, 4, 40, tzinfo=datetime.timezone.utc), 'commenter': 'augusto2112', 'type': 'User'}, {'comment_id': 443083565, 'comment_body': "It'd be nice to wait until the Linux tests finish. We'll need another round of pr testing to resolve this link issue (https://ci.swift.org/job/swift-PR-osx/21775/consoleFull#12463218453122a513-f36a-4c87-8ed7-cbc36a1ec144), so you should be able to fold in the change then.", 'comment_created': datetime.datetime(2020, 6, 20, 0, 22, 16, tzinfo=datetime.timezone.utc), 'commenter': 'vedantk', 'type': 'User'}, {'comment_id': 443174707, 'comment_body': 'The header here is messed up.', 'comment_created': datetime.datetime(2020, 6, 21, 2, 22, 38, tzinfo=datetime.timezone.utc), 'commenter': 'gottesmm', 'type': 'User'}, {'comment_id': 443174766, 'comment_body': 'Can you put this on different lines?', 'comment_created': datetime.datetime(2020, 6, 21, 2, 23, 6, tzinfo=datetime.timezone.utc), 'commenter': 'gottesmm', 'type': 'User'}, {'comment_id': 443174774, 'comment_body': 'Can you put these on different lines. It just makes it read nicer.', 'comment_created': datetime.datetime(2020, 6, 21, 2, 23, 18, tzinfo=datetime.timezone.utc), 'commenter': 'gottesmm', 'type': 'User'}, {'comment_id': 443175043, 'comment_body': 'Can you get rid of one line here and add a doxygen file level comment:

https://llvm.org/docs/CodingStandards.html#file-headers

(Modulo of course the LLVM part of the header).', 'comment_created': datetime.datetime(2020, 6, 21, 2, 27, 35, tzinfo=datetime.timezone.utc), 'commenter': 'gottesmm', 'type': 'User'}, {'comment_id': 443175081, 'comment_body': "Why not do a typedef here? So we don't have to write struct everywhere?", 'comment_created': datetime.datetime(2020, 6, 21, 2, 28, 19, tzinfo=datetime.timezone.utc), 'commenter': 'gottesmm', 'type': 'User'}, {'comment_id': 443175093, 'comment_body': 'Now this is a beautiful file level comment! Nice!', 'comment_created': datetime.datetime(2020, 6, 21, 2, 28, 44, tzinfo=datetime.timezone.utc), 'commenter': 'gottesmm', 'type': 'User'}, {'comment_id': 443175096, 'comment_body': 'This needs to be fixed.', 'comment_created': datetime.datetime(2020, 6, 21, 2, 28, 51, tzinfo=datetime.timezone.utc), 'commenter': 'gottesmm', 'type': 'User'}, {'comment_id': 443175114, 'comment_body': 'Please remove using namespace swift;', 'comment_created': datetime.datetime(2020, 6, 21, 2, 29, 8, tzinfo=datetime.timezone.utc), 'commenter': 'gottesmm', 'type': 'User'}, {'comment_id': 444400633, 'comment_body': 'Can you please add doxygen comments to each type declaration (and any non-obvious members)?', 'comment_created': datetime.datetime(2020, 6, 23, 17, 46, 35, tzinfo=datetime.timezone.utc), 'commenter': 'adrian-prantl', 'type': 'User'}, {'comment_id': 444441938, 'comment_body': "I added a doxygen comment for each declaration, although I'm not sure if they're very useful right now. 

@compnerd since you wrote these data structures, do you think I should add something more to the documentation? ", 'comment_created': datetime.datetime(2020, 6, 23, 19, 0, 30, tzinfo=datetime.timezone.utc), 'commenter': 'augusto2112', 'type': 'User'}, {'comment_id': 447265872, 'comment_body': 'Minor nit: the doxygen comments in this repository uses `///` for the comment leader.
I would describe them as:

```
/// Specifies the address range corresponding to a section.
```

and

```
/// Identifies the address space ranges for the Swift metadata required by the Swift runtime.
```

The two fields that are are "non-obvious" are `next` and `prev`:

```
/// `next` and `prev` are used by the runtime to construct a
/// circularly doubly linked list to quickly iterate over the metadata
/// from each image loaded into the address space.  These are invasive
/// to enable the runtime registration, which occurs at image load time, to
/// be allocation-free as it is invoked from an image constructor function
/// context where the system may not yet be ready to perform allocations.
/// Additionally, avoiding the allocation enables a fast load operation, which
/// directly impacts application load time.
```', 'comment_created': datetime.datetime(2020, 6, 29, 21, 30, 54, tzinfo=datetime.timezone.utc), 'commenter': 'compnerd', 'type': 'User'}]
